import React, {useState} from 'react';
import { Container, ContainerSize } from '../Container/Container';
import Button from '@mui/material/Button';
import { Spacer, Spacing } from '../Spacer/Spacer';
import { Link } from 'react-router-dom';
import {TextField} from "@mui/material";

export const Login: React.FC<{}> = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  return (
    <Container size={ContainerSize.Small}>
      <Spacer size={Spacing.m} />
      <h1>Login</h1>
        <Spacer size={Spacing.xs} />
      <p>
        Don't have an account yet? <Link to={`/register`}>Register</Link>
      </p>
        <Spacer size={Spacing.m} />
      <TextField required id="outlined-basic" label="Email" type="email" variant="filled" />
      <Spacer size={Spacing.m} />
      <TextField required id="outlined-basic" label="Password" type="password" variant="filled" />
      <Spacer size={Spacing.m} />
      <Button variant="contained">Continue</Button>
      <Spacer size={Spacing.m} />
    </Container>
  );
};
